import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Create from './Create'

class App extends Component {
constructor(props) {
  super(props);
  this.state = { blog: "" };
}
state = {users: []}

  componentDidMount() {
    let currentComponent = this; //cache the reference to this outside call back to api.get()
    fetch('http://localhost:8010/proxy/api/read') //replace this url with your proxy, to avoid CORS issues
    .then(res => res.json())
    .then(res => {
        currentComponent.setState({ blog: res.message });
        console.log(res);    
    }).catch(err => err)
    ;
  }


render() {
  return (
    <div>
  <section class="row tm-section">
   <div class="col-sm-12 col-md-12 col-lg-6 col-xl-6 p-0">
    <div class="tm-flex-center p-5 tm-bg-color-primary tm-section-min-h">
      <h1 class="tm-text-color-white tm-site-name">Personal Blogs</h1>
    </div>
  </div>
  <div class="col-sm-12 col-md-12 col-lg-6 col-xl-6">
    <div class="tm-flex-center p-5">
      <q class="tm-quote tm-text-color-gray">A simple single-page application for creating and browsing blogs.</q>
    </div>
  </div>
</section>

<section class="row tm-section tm-col-md-reverse">
 <div class="col-sm-12 col-md-12 col-lg-6 col-xl-6">
  <div class="tm-flex-center p-5">
    <div class="tm-md-flex-center">
      <h2 class="tm-text-color-primary mb-4">{this.state.response}</h2>
      <p class="mb-4">Pellentesque sagittis feugiat massa, vitae blandit elit dictum in. Nam eleifend nunc dui, sed cusus justo molestie id. Vestibulum vel sagittis justo.</p>
      <a href="#" class="btn btn-primary float-lg-right tm-md-align-center">Read more</a>
    </div>
  </div>
</div>
<div class="col-sm-12 col-md-12 col-lg-6 col-xl-6 p-0">
  <div class="tm-flex-center p-5 tm-bg-color-primary">
    <div class="tm-max-w-400 tm-flex-center tm-flex-col">
      <img src="image-04.jpg" alt="Image" class="rounded-circle mb-4"/>
    </div>
  </div>
</div>
</section>

<section class="row tm-section tm-mb-30">
  <div class="col-sm-12 col-md-12 col-lg-6 col-xl-6 p-0 text-center">
    <img src="image-01.jpg" alt="Image" class="img-fluid"/>
  </div>
  <div class="col-sm-12 col-md-12 col-lg-6 col-xl-6">
    <div class="tm-flex-center p-5">
      <div class="tm-flex-center tm-flex-col">
        <h2 class="tm-align-left">Loerm ipsum dolor sit amet</h2>
        <p>This is one-page HTML5 template that you can use for any purpose. Please tell your friends about <a href="https://www.facebook.com/templatemo" target="_parent">TemplateMo</a> website. Thank you.</p>
        <a href="#" class="btn btn-primary">Read More</a>
      </div>
    </div>
  </div>
</section>
<Create></Create>
</div>
  );
}
}

export default App;
